// src/App.js
import React, { useEffect } from 'react';
import './App.css'; // Your custom styles
import 'bootstrap/dist/css/bootstrap.min.css';
import AOS from 'aos';
import 'aos/dist/aos.css';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

function App() {
  useEffect(() => {
    AOS.init({ duration: 2000 });
  }, []);

  return (
    <Router>
      <div>
        <Navbar />
        <Jumbotron />
        <AboutMe />
        <Projects />
        <ContactMe />
        <Footer />
      </div>
    </Router>
  );
}

function Navbar() {
  return (
    <nav className="navbar navbar-expand-lg sticky-top shadow-sm">
      <div className="container-fluid">
        <Link className="navbar-brand text-light fw-bolder ms-3" to="/">Portofolio</Link>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="text-light fw-bolder nav-link" to="/">Home</Link>
            </li>
            <li className="nav-item">
              <Link className="text-light nav-link" to="#about">About Me</Link>
            </li>
            <li className="nav-item">
              <Link className="text-light nav-link" to="#project">Project</Link>
            </li>
            <li className="nav-item">
              <Link className="text-light nav-link" to="#contact">Contact Me</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

function Jumbotron() {
  return (
    <section className="jumbotron shadow-sm text-light" id="jumbotron">
      <div className="container">
        <div className="row d-flex flex-column text-center align-items-center">
          <div className="col-12">
            <h1 className="display-4">Hi! I'm Luvky Pratama Johanes</h1>
            <p className="lead short-abt font-monospace">
              A Computer Science student at BINUS with a passion for web development...
            </p>
          </div>
          <div className="col-12">
            <img src="/img/Untitled design (3).png" alt="ME" width="300" className="mt-4" />
          </div>
        </div>
      </div>
    </section>
  );
}

// Continue creating other components like AboutMe, Projects, ContactMe, and Footer...

export default App;
